package com.spacexdata.pojo;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class Rocket {    @SerializedName("rocket_id")    @Expose    public String rocketId;    @SerializedName("rocket_name")    @Expose    public String rocketName;    @SerializedName("rocket_type")    @Expose    public String rocketType;    @SerializedName("first_stage")    @Expose    public FirstStage firstStage;    @SerializedName("second_stage")    @Expose    public SecondStage secondStage;}